import React, { Component } from 'react'
import StudentMindLogo from '../../Images/icon.png'

export default class Logo extends Component {
  render() {
    return (
      <>
        <img src={StudentMindLogo} alt="Logo.png" width="50px" height="50px"/>
      </>
    )
  }
}
